import React, { useEffect, useState } from 'react';

const Menu = () => {
  const [menuData, setMenuData] = useState({});

  useEffect(() => {
    fetch('/path/to/db.json')
      .then(response => response.json())
      .then(data => setMenuData(data))
      .catch(error => console.error('Error fetching menu data:', error));
  }, []);

  // Render menu data
  if (!menuData.breakfast) return <div>Loading...</div>;

  return (
    <div>
      <h1>Breakfast</h1>
      {menuData.breakfast.map(item => (
        <div key={item.id}>
          <h2>{item.name}</h2>
          <p>{item.description}</p>
          <p>{item.price}</p>
        </div>
      ))}
      {/* Repeat similar structure for lunch, dinner, dessert */}
    </div>
  );
};

export default Menu;
